function renderPlotly(r,e,t){let o=document.querySelector("."+r);t.then(r=>{r={x:["1. kurss","2. kurss","3. kurss","4. kurss"],y:[r.course1,r.course2,r.course3,r.course4],type:"bar",marker:{color:["#1f77b4","#ff7f0e","#2ca02c","#d62728"]}};Plotly.newPlot(o,[r],{xaxis:{title:"Kursi"},yaxis:{title:"Studentu skaits"},width:800,height:500})}).catch(r=>console.error("Error loading data:",r))}export{renderPlotly};